import ProfileHover from "../src/Components/Cards"; // Adjust the path if needed
import NavBar from "../src/Components/NavBar";
import "./App.css"; // Global styles

function App() {
  return (
    <div style={{ display: 'flex' }}>
      {/* Cards on the left */}
      <div style={{ flex: 1, padding: '2rem' }}>
        <ProfileHover />
      </div>

      {/* Navbar on the right */}
      <NavBar />
    </div>
  );
}

export default App;
